import React from "react";
import "../../../Styles/Pages/Forums/ForumLatest.scss";

function ForumLatest() {
  return (
    <div className='forumLatest'>
      <div className='forumLatest__header'>
        <h3>Latest Threeads</h3>
      </div>
    </div>
  );
}

export default ForumLatest;
